import React from "react";

function TableEx(props){
    function btnClicked(){
        alert(props.data.name)
    }
    return(
        <>
            <tr key={props.index}>
         <td>{props.index+1}</td>
          <td>{props.data.name}</td>
          <td>{props.data.email}</td>
          <td>{props.data.contact}</td>
          </tr>

          <button onClick={btnClicked}>click me</button>
        </>
    )
}

export default TableEx;
